import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './EventsPage.css';

const EventsPage = () => {
  const [events, setEvents] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState('');
  const [selectedDate, setSelectedDate] = useState('');

  // Mock data for events
  useEffect(() => {
    const mockEvents = [
      {
        id: "1",
        name: "FINK India 2025 - Mumbai",
        date: "2025-04-03",
        time: "8:00 PM",
        location: "Antisocial - Lower Parel, Mumbai",
        image: "https://images.unsplash.com/photo-1529156069898-49953e39b3ac",
        description: "Folk, Indie | English | 21yrs+ | 4hrs",
        category: "Music Shows",
        price: "999"
      },
      {
        id: "2",
        name: "Pune Comedy Festival 2025",
        date: "2025-04-04",
        time: "7:30 PM",
        location: "Pune Comedy Club, Pune",
        image: "https://images.unsplash.com/photo-1515169067865-dae1abe0b6b3",
        description: "Comedy | English | 18yrs+ | 3hrs",
        category: "Comedy Shows",
        price: "799"
      },
      {
        id: "3",
        name: "Guns N' Roses India Tour 2025",
        date: "2025-05-17",
        time: "6:00 PM",
        location: "DY Patil Stadium, Mumbai",
        image: "https://images.unsplash.com/photo-1559628232-ded576a4adbc",
        description: "Rock Concert | English | All Ages | 3hrs",
        category: "Music Shows",
        price: "1999"
      },
      {
        id: "4",
        name: "All Hearts Tour - Shreya Ghoshal Live in Mumbai",
        date: "2025-05-10",
        time: "7:00 PM",
        location: "Jio World Garden, Mumbai",
        image: "https://images.unsplash.com/photo-1519671482749-fd09be7ccebf",
        description: "Bollywood Music | Hindi | All Ages | 3hrs",
        category: "Music Shows",
        price: "1499"
      }
    ];
    setEvents(mockEvents);
  }, []);

  // Filter events based on selected category and date
  const filteredEvents = events.filter(event => {
    let matchesCategory = true;
    let matchesDate = true;

    if (selectedCategory) matchesCategory = event.category === selectedCategory;
    if (selectedDate) matchesDate = event.date.includes(selectedDate);

    return matchesCategory && matchesDate;
  });

  return (
    <div className="events-page">
      {/* Filters Section */}
      <div className="filters-sidebar">
        <h3>Filters</h3>

        <div className="filter-section">
          <h4>Date</h4>
          <button onClick={() => setSelectedDate('')}>All Dates</button>
          <button onClick={() => setSelectedDate('2025-04-03')}>Today</button>
          <button onClick={() => setSelectedDate('2025-04-04')}>Tomorrow</button>
          <button onClick={() => setSelectedDate('Weekend')}>This Weekend</button>
        </div>

        <div className="filter-section">
          <h4>Categories</h4>
          <button onClick={() => setSelectedCategory('')}>All Categories</button>
          <button onClick={() => setSelectedCategory('Music Shows')}>Music Shows</button>
          <button onClick={() => setSelectedCategory('Comedy Shows')}>Comedy Shows</button>
          <button onClick={() => setSelectedCategory('Workshops')}>Workshops</button>
        </div>
      </div>

      {/* Events Section */}
      <div className="events-container">
        <h2>Events In Your City</h2>

        {/* Event Cards */}
        <div className="events-grid">
          {filteredEvents.map(event => (
            <Link to={`/events/${event.id}`} key={event.id} className="event-card">
              <img src={event.image} alt={event.name} className="event-image" />
              <div className="event-info">
                <h3>{event.name}</h3>
                <p>{new Date(event.date).toLocaleDateString()} • {event.time}</p>
                <p>{event.location}</p>
              </div>
            </Link>
          ))}
        </div>
      </div>
    </div>
  );
};

export default EventsPage;
